    },
    {
      "id": 5,
      "img": "https://i.imgur.com/GvTFS9Y.png",
      "name": "Додстер Донер",
      "price": 'От 199 сом',
    }
  ]
 
  return (
    <div>
      <OftenOrder List={List} />
    </div>
  )
}

export default MiniListCard
